            <img src={process.env.PUBLIC_URL + "/images/aartaslogo.gif"} className='img-fluid w-50 bg-transparent'/>
            </div>
          <div className="pt-5 mt-5 mb-0 position-absolute top-1 start-0 end-0">
          <video width="500" height="280" autoPlay loop muted>
  <source src={process.env.PUBLIC_URL + "/images/Closertocare.mp4"}type="video/mp4" />
  </video>
          </div>


          </div>
      </>
  )
}

export  {WelcomeLoader}
